import React, { useState } from "react";
import Modal from "@material-ui/core/Modal";
import { makeStyles } from "@material-ui/core/styles";
import Backdrop from "@material-ui/core/Backdrop";
import Fade from "@material-ui/core/Fade";

const useStyles = makeStyles((theme) => ({
  modal: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  paper: {
    backgroundColor: theme.palette.background.paper,
    border: "2px solid #000",
    boxShadow: theme.shadows[5],
    padding: theme.spacing(2, 4, 3),
  },
}));
function TransitionsModal(error) {
  const classes = useStyles();
  const [open, setOpen] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  return (
    <div>
      <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        className={classes.modal}
        open={open}
        onClose={handleClose}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 500,
        }}
      >
        <Fade in={open}>
          <div className={classes.paper}>
            <h2 id="transition-modal-title">ปัญหา{error}</h2>
            <p id="transition-modal-description">
              https://cubioinfo.com/aptitude-test/api/post/answersheets
            </p>
          </div>
        </Fade>
      </Modal>
    </div>
  );
}
export default async function get() {
  const url = "https://cubioinfo.com/aptitude-test/api/testitems/1";
  try {
    const response = await fetch(url);
    if (response.ok) {
      return await response
        .clone()
        .json()
        .catch(() => response.text());
      // return await response.json();
    }
    if (response.status <= 501) {
      TransitionsModal(response.status);

      // eslint-disable-next-line prefer-promise-reject-errors
    }
  } catch (error) {
    if (error.response) {
      /*
       * The request was made and the server responded with a
       * status code that falls out of the range of 2xx
       */
      console.log(error.response.data);
      console.log(error.response.status);
      alert(
        "เกิดปัญหา" +
          error.esponse.status +
          "\n คลิก close  เพื่อเริ่มทำแบบทดสอบใหม่อีกครั้ง"
      );
      window.location.href = `${process.env.PUBLIC_URL}`;
      console.log(error.response.headers);
    } else if (error.request) {
      /*
       * The request was made but no response was received, `error.request`
       * is an instance of XMLHttpRequest in the browser and an instance
       * of http.ClientRequest in Node.js
       */
      console.log(error.request);
    } else {
      // Something happened in setting up the request and triggered an Error
      console.log("Error", error.message);
    }
    console.log(error.config);
  }
}
